import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 48, height: 48, viewBox: "0 0 48 48", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M16 24a3.5 3.5 0 11-7 0 3.5 3.5 0 017 0z", fill: primaryFill }),
        React.createElement("path", { d: "M27.5 24a3.5 3.5 0 11-7 0 3.5 3.5 0 017 0z", fill: primaryFill }),
        React.createElement("path", { d: "M35.5 27.5a3.5 3.5 0 100-7 3.5 3.5 0 000 7z", fill: primaryFill }));
};
const MoreHorizontal48Filled = wrapIcon(rawSvg({}), 'MoreHorizontal48Filled');
export default MoreHorizontal48Filled;
